import React from 'react';
import Main from './views/Main'
import map from './map.png';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        {/* <img src={logo} className="App-logo" alt="logo" /> */}
        <div className="App">
          <Main />
        </div>
        <img className="map"src={map}/>
      </header>
    </div>
  );
}

export default App;
